import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div>
      <nav className='navbar navbar-dark bg-dark'>
        <i className='material-icons'>account_balance</i>
        <ul>
          <li>
            <Link to='/home'>Home</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
